// 사용 방법: 컴포넌트 그룹의 initialize 이벤트에 다음 코드 작성

(function (){

    // 컴포넌트 소스
    const component = {
        js: {source: './_share/Audio/Audio.js', type: 'module'},
        module: 'Audio'
    };

    // 컴포넌트 설정
    const config = {
        skin: '블루스킨',

        // element api를 설정된 name으로 찾음
        elements: {
            loading: '로딩 아이콘',
            media: '오디오',
            controllerGroup: '컨트롤러 그룹',
            controllerBg: '컨트롤러 영역 배경',

            playButton: '재생 버튼',
            pauseButton: '일시정지 버튼',
            stopButton: '정지 버튼',

            progressHandle: '재생바 핸들',
            progressBar: '재생바',
            progressBg: '재생바 배경',
            // timeText: '재생시간',

            muteButton: '볼륨 음소거 버튼',
            volumeButton: '볼륨 기본 버튼',

            volumeBarGroup: '볼륨바 그룹',
            volumeHandle: '볼륨바 핸들',
            volumeBar: '볼륨바',
            volumeBg: '볼륨바 배경',
        },

        // https://vulcan9.gitbook.io/jjapi/api-reference/mediaapi
        options: {
            //src: '_share/Audio/TOV_sample.mp3',
            checkOtherSound: false,

            //------------
            // 설정 기본값
            //------------

            /*
            src: '',
            currentTime: 0,
            loop: false,
            muted: false,
            volume : 1,
            playbackRate: 1,

            // true 이면 Native controller 그대로 사용함
            controls: false,

    		// play 시작될때 이전 모든 사운드 정지할지 여부
    		// 'pause', 'stop', true ('pause'), false (체크 안함, default)
            checkOtherSound: false,
            */
        }
    };

    //-------------------------
    // 컴포넌트 로드 & 초기화
    //-------------------------

    // 깜빡임 방지 위해 초기화 완료 이전까지 감추기
    //$self.hide();

    // 컴포넌트 소스 파일 로드 & 초기화
    $self.loadComponent(component, function (modules){
    	// const onInitialize = () => $self.show();
        const onInitialize = () => {};
        const Comp = modules[component.js.source]?.[component.module];
        (new Comp()).init($self, config, onInitialize);
    });
})();

